<dialog id="modal-editar-informacoes">
  <div class="modal-header">
    <h3>Editar informações</h3>
    <button data-action="fechar-modal">&#10006;</button>
  </div>

  <div class="modal-body">
    <form action="POST" data-action="formulario-editar-informacoes">
      <div class="group">
        <h4>Proponentes</h4>

        <div class="form-group">
          <div class="area-validation-CPF">
            <label for="CPF_1">CPF</label>
            <input type="text" size="16" id="CPF_1" data-input="CPF_1" data-mascara="cpf" placeholder="000.000.000-00" maxlength="14" required>
            <span class="icon-invalid-CPF" title="CPF inválido">&#10005;</span>
          </div>
          <br>
          <div class="area-validation-CPF">
            <label for="CPF_2">CPF</label>
            <input type="text" size="16" id="CPF_2" data-input="CPF_2" data-mascara="cpf" placeholder="000.000.000-00" maxlength="14">
            <span class="icon-invalid-CPF" title="CPF inválido">&#10005;</span>
          </div>
          <br>
          <div class="area-validation-CPF">
            <label for="CPF_3">CPF</label>
            <input type="text" size="16" id="CPF_3" data-input="CPF_3" data-mascara="cpf" placeholder="000.000.000-00" maxlength="14">
            <span class="icon-invalid-CPF" title="CPF inválido">&#10005;</span>
          </div>
          <br>
          <div class="area-validation-CPF">
            <label for="CPF_4">CPF</label>
            <input type="text" size="16" id="CPF_4" data-input="CPF_4" data-mascara="cpf" placeholder="000.000.000-00" maxlength="14">
            <span class="icon-invalid-CPF" title="CPF inválido">&#10005;</span>
          </div>
        </div>
      </div>

      <div class="group">
        <h4>Informações do processo</h4>

        <div class="form-group">
          <label for="n_contrato">Nº do contrato</label>
          <input type="text" id="n_contrato" data-input="n_contrato" size="18" data-mascara="numero-contrato" placeholder="0.0000.0000000-0" minlength="16" maxlength="16" required>
        </div>
      </div>

      <div class="group">
        <div class="form-group">
          <label for="cc_agencia">Nº da conta para débito</label>
          <input type="text" id="cc_agencia" data-input="cc_agencia" placeholder="Agência" size="4" data-mascara="agencia" maxlength="4" autocomplete="off" value="2187" required>
          <label for="cc_operacao" style="display: none">Operação</label>
          <input type="text" id="cc_operacao" data-input="cc_operacao" placeholder="Operação" size="5" data-mascara="operacao" maxlength="4" value="3701" autocomplete="off" required>
          <label for="cc_numero" style="display: none">Número</label>
          <input type="text" id="cc_numero" data-input="cc_numero" placeholder="Número" size="14" data-mascara="conta" minlength="14" maxlength="14" autocomplete="off" required>
          <button class="btn-normal" type="button" data-action="access-clipboard" style="display: inline; width: min-content">Colar</button>
        </div>
      </div>

      <div class="group">
        <div class="form-group">
          <label for="cidade">Cidade</label>
          <input type="text" id="cidade" data-input="cidade" size="15" value="Belo Horizonte" required>
        </div>

        <div class="form-group">
          <label for="data_assinatura">Data de assinatura</label>
          <input type="date" id="data_assinatura" data-input="data_assinatura" required>
        </div>
      </div>

      <div class="alert alert-warning">
        <p>Informe pelo menos 1 CPF, o número do contrato e os dados da conta bancária, além da cidade e data atual para que o formulário seja gerado.</p>
      </div>

      <button type="submit" class="block mt-1">Enviar</button>
    </form>
  </div>
</dialog>
</body>
</html>
